import React from 'react';
import s from './AddServices.module.css';
import arrow from '../../images/price/arrow.png';
import { NavLink } from 'react-router-dom';

const AddServices = () => {
    return (
        <div>
            <div>
                <NavLink to='/price'><img className={s.arrow} src={arrow}></img></NavLink>
                <span className={s.addServicesSpan}>Визуал-менеджер в Instagram</span>
            </div>
            <div className={s.servicesItems}>
                <span className={s.servicesItems}>Профессиональная ретушь</span><br />
                <span className={s.servicesItems}>Авторская обработка фотографий</span><br />
                <span className={s.servicesItems}>Монтаж видео и цветокоррекция</span><br />
                <span className={s.servicesItems}>Съёмка бэкстейджей</span><br />
            </div>
            <div className={s.footer}>
                <span id={s.firstString}>Не подошёл ни один тариф?</span><br /><br />
                <span>Оставь заявку, и мы согласуем с тобой</span>
                <p id={s.test}>индивидуальные условия</p>
            </div>
        </div>
    );
};

export default AddServices;
